require 'spec_helper'

describe SherlockAndTheBeast do
  it 'has a version number' do
    expect(SherlockAndTheBeast::VERSION).not_to be nil
  end

  let(:decent_number){ SherlockAndTheBeast.run(digits) }
  context "for 1" do 
    let(:digits){ 1 }
    it "returns -1" do
      expect(decent_number).to eq "-1"
    end
  end
  
  context "for 3" do 
    let(:digits){ 3 }
    it "returns 555" do
      expect(decent_number).to eq "555"
    end
  end

  context "for 5" do 
    let(:digits){ 5 }
    it "returns 33333" do
      expect(decent_number).to eq "33333"
    end
  end

  context "for 11" do 
    let(:digits){ 11 }
    it "returns 55555533333" do
      expect(decent_number).to eq "55555533333"
    end
  end

  context "for 1-10" do
    %w(-1
-1
555
-1
33333
555555
-1
55533333
555555555
3333333333).each_with_index do |val, idx|
      it "works for #{idx + 1}" do
        expect(SherlockAndTheBeast.run(idx + 1)).to eq val
      end
    end
  end

  context "for 69327" do
    let(:digits){ 69327 }
    let(:expected){
      ""
    }
    it "works" do
      expect(decent_number).to eq expected
    end
  end
end
